import React from 'react';
import './App.css';
import VideoStream from './components/VideoStream';
import Navigation from './components/Navigation';

function App() {
  return (
    <div className="App">
      <Navigation />
      <header className="App-header">
        <h1>ROS2 Camera Stream</h1>
      </header>
      <main>
        <VideoStream />
      </main>
    </div>
  );
}

export default App;
